// src/components/services/BatchProcessing.js
import React, { useState } from 'react';
import { MOCK_BATCH_RESULTS, MOCK_BATCH_SUMMARY } from '../../data/mockData';

const BatchProcessing = () => {
  const [files, setFiles] = useState([]);
  const [results, setResults] = useState(null);
  const [isProcessing, setIsProcessing] = useState(false);
  const [summary, setSummary] = useState(null);

  const demoFiles = [
    { name: 'senior_security_architect_job.pdf', size: 187392 },
    { name: 'penetration_tester_position.pdf', size: 156672 },
    { name: 'soc_analyst_opening.pdf', size: 143360 },
    { name: 'infosec_manager_role.pdf', size: 198144 },
    { name: 'cybersecurity_consultant_job.pdf', size: 175104 },
    { name: 'security_engineer_posting.pdf', size: 164896 }
  ];

  const handleFileUpload = (event) => {
    const uploadedFiles = Array.from(event.target.files);
    setFiles(uploadedFiles);
  };

  const loadDemoFiles = () => {
    const mockFiles = demoFiles.map(fileInfo => ({
      name: fileInfo.name,
      size: fileInfo.size,
      type: 'application/pdf'
    }));
    setFiles(mockFiles);
  };

  const processFiles = () => {
    if (files.length === 0) {
      alert('Please select job posting files to process or load demo files');
      return;
    }

    setIsProcessing(true);
    setTimeout(() => {
      setResults(MOCK_BATCH_RESULTS);
      setSummary(MOCK_BATCH_SUMMARY);
      setIsProcessing(false);
    }, 3000);
  };

  const clearFiles = () => {
    setFiles([]);
    setResults(null);
    setSummary(null);
  };

  const downloadResults = () => {
    if (!results) return;

    const dataStr = JSON.stringify(results, null, 2);
    const dataBlob = new Blob([dataStr], { type: 'application/json' });
    const url = URL.createObjectURL(dataBlob);
    const link = document.createElement('a');
    link.href = url;
    link.download = 'batch_analysis_results.json';
    link.click();
  };

  return (
    <div className="space-y-6">
      <div className="bg-green-50 border border-green-200 rounded-lg p-4">
        <h4 className="text-green-800 font-semibold mb-2">Batch Processing</h4>
        <p className="text-green-700 text-sm">
          Upload multiple job postings to extract and summarize cybersecurity skills across 6 specialized domains.
        </p>
      </div>

      <div className="bg-white border border-gray-200 rounded-lg p-6">
        <div className="form-group mb-4">
          <label className="block text-sm font-medium text-gray-700 mb-2">
            Upload Job Postings for Skill Extraction
          </label>
          <input
            type="file"
            multiple
            accept=".pdf,.doc,.docx,.txt"
            onChange={handleFileUpload}
            className="w-full p-3 border border-gray-300 rounded-lg focus:ring-2 focus:ring-green-500 focus:border-green-500"
          />
        </div>

        <p className="text-gray-600 mb-3">Try our demo files to see the system in action:</p>
        <button 
          onClick={loadDemoFiles} 
          className="bg-gray-600 text-white px-4 py-2 rounded-lg hover:bg-gray-700 transition-colors text-sm mb-4"
        >
          Load Demo Job Postings ({demoFiles.length} sample cybersecurity positions)
        </button>

        {files.length > 0 && (
          <div className="mb-4">
            <h5 className="font-semibold text-gray-900 mb-2">Selected Files ({files.length})</h5>
            <div className="bg-gray-50 rounded-lg p-3 max-h-40 overflow-y-auto">
              {files.map((file, index) => (
                <div key={index} className="text-sm text-gray-700 py-1">
                  {file.name} ({(file.size / 1024).toFixed(1)} KB)
                </div>
              ))}
            </div>
          </div>
        )}

        <div className="flex gap-3 flex-wrap">
          <button
            onClick={processFiles}
            disabled={isProcessing || files.length === 0}
            className="bg-green-600 text-white px-6 py-3 rounded-lg hover:bg-green-700 disabled:opacity-50 disabled:cursor-not-allowed font-medium transition-colors"
          >
            {isProcessing ? 'Extracting...' : 'Extract Skills from Job Postings'}
          </button>
          <button 
            onClick={clearFiles} 
            className="border border-red-300 text-red-700 px-6 py-3 rounded-lg hover:bg-red-50 font-medium transition-colors"
          >
            Clear All
          </button>
        </div>
      </div>

      {isProcessing && (
        <div className="bg-blue-50 border border-blue-200 rounded-lg p-4">
          <div className="flex items-center gap-3">
            <div className="animate-spin rounded-full h-5 w-5 border-b-2 border-blue-600"></div>
            <div>
              <div className="text-blue-800 font-medium">Processing: Extracting skills from {files.length} job postings...</div>
              <div className="text-blue-600 text-sm">Analyzing cybersecurity roles across 6 specialized domains</div>
            </div>
          </div>
        </div>
      )}

      {summary && (
        <div className="bg-white border border-gray-200 rounded-lg p-6">
          <h4 className="text-lg font-semibold text-gray-900 mb-4">Extraction Summary</h4>
          <div className="grid grid-cols-2 md:grid-cols-4 gap-4 text-center">
            <div className="bg-green-50 rounded-lg p-4">
              <div className="text-2xl font-bold text-green-600">{summary.total_jobs}</div>
              <div className="text-sm text-green-700">Job Postings</div>
            </div>
            <div className="bg-blue-50 rounded-lg p-4">
              <div className="text-2xl font-bold text-blue-600">{summary.categories_found}</div>
              <div className="text-sm text-blue-700">Categories Found</div>
            </div>
            <div className="bg-purple-50 rounded-lg p-4">
              <div className="text-lg font-bold text-purple-600">{summary.model_mode}</div>
              <div className="text-sm text-purple-700">Model Mode</div>
            </div>
            <div className="bg-orange-50 rounded-lg p-4">
              <div className="text-lg font-bold text-orange-600">{summary.extractor_mode}</div>
              <div className="text-sm text-orange-700">Extractor Mode</div>
            </div>
          </div>
        </div>
      )}

      {results && (
        <div className="bg-white border border-gray-200 rounded-lg p-6">
          <div className="flex justify-between items-center mb-6">
            <h4 className="text-lg font-semibold text-gray-900">Skill Extraction Results</h4>
            <button 
              onClick={downloadResults} 
              className="border border-green-600 text-green-600 px-4 py-2 rounded-lg hover:bg-green-50 font-medium transition-colors text-sm"
            >
              Download Results
            </button>
          </div>

          <div className="grid gap-6 md:grid-cols-2">
            {results.map((result, index) => (
              <div key={index} className="border border-gray-200 rounded-lg p-4">
                <h5 className="font-semibold text-gray-900 mb-2">{result.job_title}</h5>
                <div className="mb-3">
                  <span 
                    className="inline-block px-3 py-1 rounded-full text-white text-sm font-medium" 
                    style={{ backgroundColor: result.prediction.category_color }}
                  >
                    {result.prediction.category_name}
                  </span>
                  <p className="text-gray-600 text-sm mt-2">{result.prediction.category_description}</p>
                </div>

                <h6 className="font-medium text-gray-900 mb-2">
                  Skills Found ({result.skills.skill_count})
                </h6>

                <div className="space-y-2">
                  {result.skills.extracted_skills.slice(0, 3).map((skill, i) => (
                    <div key={i} className="bg-gray-50 px-3 py-2 rounded text-sm">
                      <span className="font-medium text-gray-900">{skill.name}</span>
                    </div>
                  ))}
                  {result.skills.skill_count > 3 && (
                    <div className="text-sm text-gray-600 bg-gray-100 px-3 py-2 rounded">
                      +{result.skills.skill_count - 3} more skills
                    </div>
                  )}
                </div>
              </div>
            ))}
          </div>
        </div>
      )}
    </div>
  );
};

export default BatchProcessing;
